in_source: |-
  ( var sum 0 ) ( var a 0 ) ( var b 1 ) ( var bound 400000 )
  ( while ( < b bound ) (
  ( if ( = 0 ( % b 2 ) ) ( var sum ( + b sum ) ) ( + 0 0 ) )
  ( var tmp b )
  ( var b ( + a b ) )
  ( var a tmp ) ) )
  ( print sum )
